schIntroFr.markdown:
Vous pouvez nous demander de vous téléphoner. Remplissez le formulaire pour nous dire comment nous pouvons vous aider. Nous communiquerons avec vous dans les 2 jours ouvrables.

 L’aide que vous pouvez obtenir se limite aux situations suivantes :


  * obtenir de l’information sur un trop payé en lien avec le paiement initial de 2000 $ de la PCU;
 * obtenir des renseignements généraux;
 * présenter une demande d'assurance-emploi;
 * soumettre des renseignements supplémentaires et des documents justificatifs (notes médicales, relevés d’emploi);
 * soumettre des déclarations du prestataire;
 * mettre à jour les renseignements relatifs au dépôt direct et votre adresse.

